script: |
  super -f text -I q13838.spq | sort > q13838.out

inputs:
  - name: q13838.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT IN ( - + 77, col0, + - col2 - col1 + - col2 / + 65, - ( - + col2 ), - - 17, col0, - + 28 * 40 * col0 * 47, + col2 );
  - name: tab2

outputs:
  - name: q13838.out
    data: |
      46	51	23
      64	77	40
      75	67	58
